var app=angular.module("time",["ngRoute","angularSpinner"]);app.config(["$routeProvider",function(n){n.when("/",{templateUrl:"templates/login.html",controller:"LoginCtrl"}).when("/login",{templateUrl:"templates/login.html",controller:"LoginCtrl"}).when("/register",{templateUrl:"templates/register.html",controller:"RegisterCtrl"}).when("/dashboard",{templateUrl:"templates/dashboard.html",controller:"DashboardCtrl"}).when("/courses",{templateUrl:"templates/courses.html",controller:"CoursesCtrl"}).when("/course/:ID",{templateUrl:"templates/course.html",controller:"CourseCtrl"}).when("/project/:ID",{templateUrl:"templates/project.html",controller:"ProjectCtrl"}).when("/group/:ID",{templateUrl:"templates/group.html",controller:"GroupCtrl"}).when("/users",{templateUrl:"templates/users.html",controller:"UsersCtrl"}).when("/user/:ID",{templateUrl:"templates/user.html",controller:"UserCtrl"}).when("/assignEval/:ID",{templateUrl:"templates/assignEval.html",controller:"AssignEvalCtrl"}).when("/viewEvals/:ID",{templateUrl:"templates/viewEvals.html",controller:"ViewEvalsCtrl"}).otherwise("/")}]);app.config(["usSpinnerConfigProvider",function(n){n.setDefaults({color:"#18BC9C",radius:15})}]);app.filter("orderObjectBy",function(){return function(n,t,i){var r=[];return angular.forEach(n,function(n){r.push(n)}),r.sort(function(n,i){return n[t]>i[t]?1:-1}),i&&r.reverse(),r}});